import React from 'react';

const Nav = () => {
    return (
        <div>
            <div className='flex'>
                <img className='ml-20' src="data:image/png;base64," alt="" srcset="" />
                <h1 className='mt-20 text-4xl font-bold'></h1>
            </div>
            <h2 className='ml-24  text-4xl mb-10'>
                Select today's ecercise.....
            </h2>
        </div>
    );
};

export default Nav;
